(() => {
  if (window.__vacConsoleEgg) return;
  
  const translations = [
    "YOU DIDN'T SAY THE MAGIC WORD!", // Inglés
    "¡NO DIJISTE LA PALABRA MÁGICA!", // Español
  ];

  let triggered = false;

  const runEasterEgg = () => {
    if (triggered) return;
    triggered = true;
    window.__vacConsoleEgg = true;

    const banner = 'access:  PERMISSION DENIED.\n> access main security grid\naccess:  PERMISSION DENIED... and...';
    const bannerStyle = 'color:#fff;background:#002bff;padding:4px;font-family:monospace;font-size:12px;font-weight:bold;';
    
    // GIF Configuration (Base64)
    const gifUrl = 'data:image/gif;base64,';
    const gifStyle = [
      'display: block;',
      'font-size: 1px;',
      'padding: 80px 100px;', 
      'background-image: url(' + gifUrl + ');',
      'background-size: contain;',
      'background-repeat: no-repeat;',
      'background-position: center;',
      'color: transparent;',
      'line-height: 0;' 
    ].join('');

    // Select a random message
    const randomMsg = translations[Math.floor(Math.random() * translations.length)];
    const msgStyle = 'color:#fff;background:#002bff;padding:4px 8px;font-family:monospace;font-weight:bold;font-size:14px;';

    // Execute once - NO LOOP to avoid flickering
    console.clear();
    console.log('%c' + banner, bannerStyle);
    console.log('%c ', gifStyle);
    console.log('%c' + randomMsg, msgStyle);
  };

  // DevTools Detection (Polling)
  setInterval(() => {
    if (triggered) return;
    const threshold = 160;
    const widthDiff = window.outerWidth - window.innerWidth;
    const heightDiff = window.outerHeight - window.innerHeight;
    if (widthDiff > threshold || heightDiff > threshold) {
      runEasterEgg();
    }
  }, 1000);
})();
